&lt;style&gt;body {
  position: absolute;
  left: 0;
  top: 0;
  bottom: 0;
  right: 0;
}

#slipshow-main {
  position: relative;
  flex-grow: 1;
}

#slipshow-open-window {
  position: absolute;
  overflow: hidden;
  background-color: white;
}

.slipshow-format-container {
  transform-origin: top left;
}
.slip, .slide {
  width: calc(var(--page-width) - 2px);
  transform-origin: top left;
  /* Borders make margin of inner elements not leak outside */
  border: 1px solid transparent;
}

.slide {
  height: calc(var(--page-height) - 2px);
  width: calc(var(--page-width) - 2px);
}

.slipshow-rescaler {
  overflow-x: hidden;
  overflow-y: hidden;
  /* Whether or not to hide what's outside of rescalers is not clear. I decided to
   hide to avoid having the shadow of the title leak outside. */
  width: unset;
  height: unset;
  min-width: 0;
}
html,
body {
  margin: 0;
  padding: 0;
  background-color: black;
}

#slipshow-universe {
  /* position: absolute; */
  /* top: 0; */
  /* left: 0; */
  contain: paint layout;
}

.slipshow-scale-container {
    /* contain: paint layout; */
    will-change: transform
}
.pauseAncestor ~ *, .pauseTarget {
  opacity: 0;
  pointer-events: none;
}

.unstatic {
  position: absolute;
  visibility: hidden;
}

.unrevealed {
  opacity: 0;
  pointer-events: none;
}

#slipshow-counter {
  position: absolute;
  bottom: 0;
  right: 0;
  background-color: white;
  padding: 5px;
  font-size: 2em;
  border: 1px solid black;
  border-radius: 5px;
  cursor: pointer;
}

.slipshow__carousel &gt; .slipshow__carousel_children:not(.slipshow__carousel_active) {
  position: absolute;
  visibility: hidden;
}

[slipshow-pdf] {
  display:inline-block;
}

[slipshow-pdf] canvas {
  display: block;
  width: 100%;
}

.__slipshow__speaker_note {
    display: none;
}
&lt;/style&gt;
&lt;style&gt;.slipshow-drawing-mode #slipshow-open-window &gt; *,
.slipshow-editing-mode #slipshow-open-window &gt; *{
  pointer-events: none;
}

#slipshow-drawing-toolbar {
  position: absolute;
  top: 0;
  left: 0;
}

#slipshow-drawing-toolbar:hover,
.slipshow-editing-mode #slipshow-drawing-toolbar {
  max-width: 50%;
  max-height: 100vh;
}
.slipshow-drawing-mode #slipshow-drawing-toolbar {
  max-height: 100vh;
}
#slipshow-drawing-toolbar:hover {
  transition:
    max-width 0.3s,
    max-height 0.3s;
}
#slipshow-drawing-toolbar {
  transition:
    max-width 0.3s 0.5s,
    max-height 0.3s 0.5s;
  overflow: hidden;
  max-width: 32px;
  max-height: 32px;
  border-radius: 0px 0px 16px 16px;
  background-color: white;
  border-right: 1px solid black;
  border-bottom: 1px solid black;
}
.slip-writing-toolbar {
  display: flex;
  flex-direction: column;
  max-width: 100vw;
  max-height: 100vh;
  flex-wrap: wrap;
  z-index: 10;
  user-select: none;
}

.slip-writing-toolbar &gt; .tool-block {
  display: flex;
  flex-direction: column;
  margin-bottom: 10px;
  gap:2px;
  padding-right: 10px;
}
.slip-writing-toolbar &gt; .tool-block:not(:last-child) {
  border-bottom: 1px solid black;
  padding-bottom: 10px;
  padding-right: 10px;
}
.slip-writing-toolbar .slipshow-icon {
  width: 30px;
  height: 30px;
  border: 1px solid black;
  border-radius: 30px;
  transition: border-radius 0.5s;
  display:flex;
  align-items: center;
  justify-content: center;
}
.slip-writing-toolbar .slipshow-manage-recording-block .slipshow-icon {
  border: 1px solid transparent;
}
.slipshow-manage-recording {
  padding-left: 10px;;
  padding-right: 10px;
  padding-bottom: 10px;
}
.slipshow-button {
  cursor: pointer;
  white-space: nowrap;
}

.slip-writing-toolbar &gt; .slip-toolbar-color &gt; .slip-toolbar-red {
  background-color: red;
}
.slip-writing-toolbar &gt; .slip-toolbar-color &gt; .slip-toolbar-black {
  background-color: black;
}
.slip-writing-toolbar &gt; .slip-toolbar-color &gt; .slip-toolbar-blue {
  background-color: blue;
}
.slip-writing-toolbar &gt; .slip-toolbar-color &gt; .slip-toolbar-green {
  background-color: green;
}
.slip-writing-toolbar &gt; .slip-toolbar-color &gt; .slip-toolbar-yellow {
  background-color: yellow;
}
.slip-writing-toolbar .slipshow-button {
  display: flex;
  justify-content: left;
  align-items: center;
  gap: 5px;
  font-size: 25px;
}
.slip-writing-toolbar &gt; .slip-toolbar-width .slipshow-icon &gt; * {
  width: 14px;
  border-radius: 16px;
}

.slip-writing-toolbar &gt; .slip-toolbar-width .slip-toolbar-small.slipshow-icon &gt; * {
  border: 1px solid black;
}
.slip-writing-toolbar &gt; .slip-toolbar-width .slip-toolbar-medium.slipshow-icon &gt; * {
  border: 2px solid black;
}
.slip-writing-toolbar &gt; .slip-toolbar-width .slip-toolbar-large.slipshow-icon &gt; * {
  border: 4px solid black;
}
.slip-writing-toolbar .slipshow-icon.slip-set-tool,
.slip-writing-toolbar .slipshow-icon.slip-set-width {
  background-color: lightsteelblue;
  border-radius: 5px;
}

.slip-writing-toolbar .slip-set-color {
  height: 28px;
  width: 28px;
  border: 2px solid steelblue;
  border-radius: 5px;
}

kbd.slipshow-key {
  border: 1px solid black;
  padding: 2px;
  border-radius: 6px;
  margin-left: 15px;
  background: rgb(225, 225, 225);
  font-size: 0.75em;
}

kbd.slipshow-key-panel {
  border: 1px solid black;
  border-radius: 6px;
  background: rgb(225, 225, 225);
  padding: 5px;
}

#slipshow-drawing-editor {
  font-size: 24px;
}

#slipshow-drawing-editor select {
  font-size: 24px;
}

#slipshow-drawing-editor input[type=&quot;text&quot;] {
  font-size: 20px;
}
#slipshow-drawing-editor {
  /* overflow: auto; */
  opacity: 0.98;
  top: 0;
  left: 0;
  bottom: 0;
  padding: 30px;
  background:#e9c46a;
  z-index: 100;
}
.slipshow-dont-display {
  display: none;
}
.slipshow-drawing-editor-display {
  stroke: darkorange;
}
.time-slider {
  width: 100%;
}
.slipshow-toc-mode #slipshow-toc {
  display: block;
}

#slipshow-toc {
  overflow: auto;
  opacity: 0.98;
  top: 0;
  left: 0;
  bottom: 0;
  min-width: 25%;
  max-width: 30%;
  padding: 30px;
  background: rosybrown;
  display: none;
  z-index: 100;
}

.slipshow-toc-step {
  display: inline-block;
  border: 1px solid black;
  border-radius: 3px;
  padding: 5px;
  padding-bottom: 0px;
  margin: 5px;
  margin-left: 0;
  margin-right: 10px;
}

.slipshow-toc-only-step {
  display: inline-block;
}

.slipshow-toc-entry {
  cursor: pointer;
}

.slipshow-toc-current-step .slipshow-toc-step {
  background-color: red;
}
#slip-touch-controls {
  display: none;
}

.mobile #slip-touch-controls {
  display: unset;
}

.mobile.slipshow-toc-mode.horizontal #slip-touch-controls,
.mobile.slipshow-toc-mode.vertical #slip-touch-controls {
  display: none;
}

.mobile.horizontal #slip-touch-controls {
  position: fixed;
  bottom: 0;
  width: 100%;
  display: flex;
  height: 10vw;
  justify-content: space-evenly;
}

.mobile.horizontal #slip-touch-controls &gt; div {
  width: 10vw;
  background: rgba(0, 0, 0, 0.3);
  cursor: pointer;
  color: white;
  font-size: 10vw;
  text-align: center;
  vertical-align: middle;
  line-height: 10vw;
}

.mobile.vertical #slip-touch-controls {
  position: fixed;
  right: 0;
  width: 10vh;
  display: flex;
  height: 80vh;
  justify-content: space-evenly;
  flex-direction: column;
}

.mobile.vertical #slip-touch-controls &gt; div {
  width: 10vh;
  background: rgba(0, 0, 0, 0.3);
  cursor: pointer;
  color: white;
  font-size: 10vh;
  text-align: center;
  vertical-align: middle;
  line-height: 10vh;
}


body.slipshow-drawing-mode,
body.slipshow-editing-mode{
  touch-action: pinch-zoom;
}

#slipshow-vertical-flex {
  display: flex;
  height: 100vh;
  flex-direction: column;
  overflow: hidden;
}
#slipshow-horizontal-flex {
  display: flex;
  flex-grow: 1;
  flex-direction: row-reverse;
  overflow: hidden;
}

#slipshow-content {
  border: 1px solid transparent;
}

/* See drawing/event.ml and drawing_editor/editor_tools.ml if you modify.

   Adds padding so that you can draw on the side of your content */
#slipshow-universe {
  padding: 2000px;
  min-width: var(--page-width);
  min-height: var(--page-height);
}

.slipshow-blink {
  animation: blink 2s step-start 0s infinite;
}
@keyframes blink {
  50% {
    opacity: 0.0;
  }
}

.slipshow-svg-container {
  display: inline-block;
}
.slipshow-svg-container svg {
  width: 100%;
  height: auto;
}
&lt;/style&gt;

.slip-body, .slide-body {
  /* padding:60px; */
  margin-top: auto;
  margin-bottom: auto;
  margin-left: 110px;
  margin-right: 110px;
}

.slide {
  display: flex;
  flex-direction: column;
}

.slide-title {
    flex: 0 1 auto;
    -webkit-box-shadow: 0px 5px 18px 5px rgba(0,0,0,0.42); 
    box-shadow: 0px 5px 18px 5px rgba(0,0,0,0.42);
    font: 1.8em &quot;Liberation Sans&quot;, sans-serif;
    background: linear-gradient(to right, #004dc9, #001e63);
    /* Negative margin to consider the 1px margin of slides rescaler content */
    margin-left: -1px;
    margin-top: -1px;
    color: white;
    padding: 10px;
    padding-left:60px;
    /* Minus the left and right padding and left margin */
    width: calc(var(--page-width) - 60px - 10px + 1px);
}

.slide-body {
  font-size: 1.4em;
    /* flex-grow: 1; */
    /* padding-top: 100px; */
}

.slide-body &gt; h1:first-child:not(#slipshow-toc h1) {
  position: absolute;
  top: -2px;
  left: -2px;
  margin-top: 0;
  padding-top: 20px;
  padding-left: 60px;
  color: white;
  right: -2px;
  text-align: left;
  box-shadow: 0px 5px 18px 5px rgba(0,0,0,0.42);
  background: linear-gradient(to right, #004dc9, #001e63);
  font: 51.84px &quot;Liberation Sans&quot;, sans-serif;
  padding-bottom: 10px;
  margin-bottom: 20px;
}

body {
  font:
    30px &quot;Liberation Sans&quot;,
    sans-serif;
}

h1:not(#slipshow-toc h1) {
  text-align: center;
}

/*************************************/
/*    Blocks                         */
/*************************************/

.block,
.theorem,
.lemma,
.definition,
.example,
.my-theorem,
.corollary,
.remark {
  display: block;
  margin-top: 20px;
  margin-bottom: 40px;
  padding: 30px;
  border-radius: 10px;
  -webkit-box-shadow: 5px 5px 18px 5px rgba(0, 0, 0, 0.42);
  box-shadow: 5px 5px 18px 5px rgba(0, 0, 0, 0.42);
  background-color: white;
}
.block:before,
.theorem:before,
.lemma:before,
.definition:before,
.example:before,
.my-theorem:before,
.corollary:before,
.remark:before {
  font-weight: bold;
  display: block;
  margin-top: -30px;
  margin-left: -30px;
  border-radius: 5px 5px 0 0;
  margin-right: -30px;
  margin-bottom: 15px;
  padding: 6px;
  padding-left: 30px;
  color: white;
  font-style: normal;
}
.block[title]:before {
  content: &quot;&quot; attr(title) &quot;&quot;;
  background-color: darkgrey;
}

/*************************************/
/*    Theorems                       */
/*************************************/

.theorem {
  font-style: italic;
  background-color: lightpink;
  border: 1px solid darkred;
}
.theorem:before {
  text-align: left;
  content: &quot;Theorem&quot;;
  background-color: darkred;
}
.theorem[title]:before {
  content: &quot;Theorem (&quot; attr(title) &quot;) &quot;;
}

/*************************************/
/*    Theorems                       */
/*************************************/

.my-theorem {
  font-style: italic;
  background-color: lightgoldenrodyellow;
  border: 1px solid darkgoldenrod;
}
.my-theorem:before {
  text-align: left;
  content: &quot;Theorem&quot;;
  background-color: darkgoldenrod;
}
.my-theorem[title]:before {
  content: &quot;Theorem (&quot; attr(title) &quot;) &quot;;
}

/*************************************/
/*    Lemmas                         */
/*************************************/

.lemma {
  font-style: italic;
  background-color: lightgray;
  border: 1px solid darkgray;
}
.lemma:before {
  content: &quot;Lemma&quot;;
  background-color: darkgray;
}
.lemma[title]:before {
  content: &quot;Lemma (&quot; attr(title) &quot;) &quot;;
}

/*************************************/
/*    Proof                          */
/*************************************/

.proof {
  display: block;
  margin: 12px 0;
  font-style: normal;
}
.proof:before {
  content: &quot;Proof.&quot;;
  font-style: italic;
  margin-right: 1ch;
}
.proof:after {
  content: &quot;\25FC&quot;;
  float: right;
}

/*************************************/
/*    Definitions                    */
/*************************************/

.definition {
  font-style: normal;
  background-color: lightblue;
  border: 1px solid darkblue;
}
.definition:before {
  content: &quot;Definition.&quot;;
  background-color: darkblue;
}
.definition[title]:before {
  content: &quot;Definition (&quot; attr(title) &quot;) &quot;;
}

/*************************************/
/*    Examples                       */
/*************************************/

.example {
  font-style: normal;
  background-color: lightgreen;
  border: 1px solid darkgreen;
}
.example:before {
  content: &quot;Example.&quot;;
  background-color: darkgreen;
}
.example[title]:before {
  content: &quot;Example (&quot; attr(title) &quot;) &quot;;
}

/*************************************/
/*    Remark                         */
/*************************************/

.remark {
  font-style: normal;
  background-color: lightgreen;
  border: 1px solid darkgreen;
}
.remark:before {
  content: &quot;Remark.&quot;;
  background-color: darkgreen;
}
.remark[title]:before {
  content: &quot;Remark (&quot; attr(title) &quot;) &quot;;
}

/*************************************/
/*    Corollary                      */
/*************************************/

.corollary {
  font-style: normal;
  background-color: lightyellow;
  border: 1px solid #cccc00;
}
.corollary:before {
  content: &quot;Corollary.&quot;;
  background-color: #cccc00;
}
.corollary[title]:before {
  content: &quot;Corollary (&quot; attr(title) &quot;) &quot;;
}
